import React, { useState } from 'react';
import { LineChart, Line, XAxis, YAxis, Tooltip, CartesianGrid, ResponsiveContainer } from 'recharts';
import './visibility-chart.css';

// Chart Component
const Visibility = ({ data }) => {
  const dataParse = data.list.slice(0, 8);

  const chartData = dataParse.map((item) => ({
    time: Number(item.dt_txt.slice(11, 13)),
    visibility: item.visibility,
  }));

  const [chartOptions, setChartOptions] = useState({
    title: "Visibility",
    data: chartData,
    series: [{ type: 'line', xKey: 'time', yKey: 'visibility' }],
    axes: [{ type: 'ordinal', position: 'bottom', tick: { count: 8 } }, { type: 'number', position: 'right' }],
  });

  return (
    <ResponsiveContainer className='vis'>
      <LineChart data={chartOptions.data}>
        <XAxis dataKey="time" type="number" />
        <YAxis />
        <CartesianGrid strokeDasharray="3 3" />
        <Tooltip />
        {chartOptions.series.map((s, index) => (
          <Line key={index} type={s.type} dataKey={s.yKey} />
        ))}
      </LineChart>
    </ResponsiveContainer>
  );
};

export default Visibility;
